import React, { useState } from "react";
import { Button } from "@material-ui/core";
import Square from "./../components/square";

function Game() {
  const [state, setstate] = useState("X");
  function abc() {
    if (state == "X") {
      setstate("O");
    } else {
      setstate("X");
    }
  }
  function renderSquare(i: number) {
    return <Square onClick={abc()} value={state}></Square>;
  }

  return (
    <div>
      {renderSquare(0)}
      {renderSquare(1)}
      {renderSquare(2)}
      <br></br>
      {renderSquare(3)}
      {renderSquare(4)}
      {renderSquare(5)}
      <br></br>
      {renderSquare(6)}
      {renderSquare(7)}
      {renderSquare(8)}
      <br></br>
    </div>
  );
}

export default Game;
